INSERT INTO `systemRankings` (`tournamentRankingID`, `name`, `numberOfInstances`, `description`, `Pool_Bracket`, `Pool_Sets`, `Scored_Event`, `displayFunction`, `scoringFunction`, `rankingFunction`, `advancementFunction`, `scoreFormula`, `groupWinnersFirst`, `orderByField1`, `orderBySort1`, `orderByField2`, `orderBySort2`, `orderByField3`, `orderBySort3`, `displayTitle1`, `displayField1`, `displayTitle2`, `displayField2`, `displayTitle3`, `displayField3`, `displayTitle4`, `displayField4`, `displayTitle5`, `displayField5`) VALUES
(1, 'Franklin 2014', 81, 'Calculation:\n +[Points For]\n +(5 * [Wins])\n -[Points Against]\n -(Doubles Penalty)\n\nDoubles Penalty\n1 Double -> 1 = 1\n2 Doubles -> 1+2 = 3\n3 Doubles -> 1+2+3 = 6 etc...\n\nRanking:\n1) Pool winners first\n2) Score\n3) Wins\n4) Doubles', 1, 0, 0, NULL, NULL, NULL, NULL, '(5*wins) + pointsFor - pointsAgainst - ((doubles * (doubles+1))/2)', 1, 'score', 'DESC', 'wins', 'DESC', 'doubles', 'ASC', 'Wins', 'wins', 'Points For', 'pointsFor', 'Points Against', 'pointsAgainst', 'Doubles', 'doubles', 'Score', 'score'),
(2, 'RSS Cutting', 10, 'Root Sum Square Cutting\n\nScoring\nTotal Deduction = sqrt([Cut Deduction]^2 + [Form Deduction]^2)\nScore = 20 - Cut Deduction\n\nRanking\n1) By Score\n2) Least deductions', 0, 0, 1, 'RSScutting', 'RSScutting', NULL, NULL, NULL, 0, 'score', 'DESC', NULL, NULL, NULL, NULL, 'Score', 'score', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 'Results Only', 12, NULL, 0, 0, 0, NULL, NULL, NULL, NULL, NULL, 0, 'score', 'DESC', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 'Deduction Based', 2, 'Scoring\r\n100 point base score\r\nDeductions from the base score', 0, 0, 1, 'DeductionBased', 'DeductionBased', NULL, NULL, 'pointsFor', 0, 'score', 'DESC', NULL, NULL, NULL, NULL, 'Score', 'score', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 'FNY 2017', 2, 'Fechtshule New York 2017\r\n\r\nScoring:\r\nOne exchange matches\r\n+ 1*Wins\r\n- 2*[Losses]\r\n- 2*[Doubles]\r\n\r\nRanking:\r\nCumulative across multiple pools', 0, 1, 0, NULL, NULL, NULL, 'FNY2017', 'pointsFor - 2 * (losses + doubles)', 0, 'score', 'DESC', 'wins', 'DESC', 'doubles', 'ASC', 'Wins', 'wins', 'Pushes', 'matches - hitsFor - losses - doubles', 'Losses', 'losses', 'Doubles', 'doubles', 'Score', 'score'),
(6, 'Seeded Pool', 1, 'First pool of top fighters. Fighters in the first pool are ranked ahead of all other fighters, regardless of score.\r\n\r\nScoring uses Franklin 2014.\r\n\r\nUse when there are a few fighters with a significant skill gap above other competitors.', 1, 0, 0, NULL, NULL, NULL, NULL, '(5*wins) + pointsFor - pointsAgainst - ((doubles * (doubles+1))/2)', 0, 'wins', 'DESC', 'scores', 'DESC', 'doubles', 'ASC', 'Wins', 'wins', 'Points For', 'pointsFor', 'Points Against', 'pointsAgainst', 'Doubles', 'doubles', 'Score', 'score'),
(7, 'Total Points Scored', 3, 'Scoring\r\n +[Points For]\r\n\r\nRanking\r\n1) Wins\r\n2) Score\r\n3) Doubles', 1, 0, 0, NULL, NULL, NULL, NULL, 'pointsFor', 0, 'wins', 'DESC', 'score', 'DESC', 'doubles', 'ASC', 'Wins', 'wins', 'Score', 'score', NULL, NULL, NULL, NULL, NULL, NULL),
(8, 'Hit Ratio', 1, 'Score\r\n[Points For] / [Total Times Hit]\r\n\r\nRanking\r\n1) Score\r\n2) Wins', 1, 0, 0, NULL, NULL, NULL, NULL, 'pointsFor / (hitsAgainst + afterblowsAgainst + doubles)', 0, 'score', 'DESC', 'doubles', 'ASC', 'wins', 'DESC', 'Points For', 'pointsFor', 'Total Times Hit', 'hitsAgainst + afterblowsAgainst + doubles', 'Score', 'score', NULL, NULL, NULL, NULL),
(9, 'Sandstorm 2017', 2, 'Scoring:\r\n3 Points - Controlled Win/Artful Exchange\r\n2 Points - Win\r\n1 Point - Win w/ Afterblow\r\n\r\nRanking:\r\nBy Score\r\n', 1, 0, 0, NULL, NULL, NULL, NULL, 'pointsFor - doubles', 0, 'score', 'DESC', 'wins', 'DESC', 'doubles', 'ASC', 'Control Wins', 'score + doubles - (2*wins) - (3*afterblowsAgainst)', 'Wins', '(3 * wins) - (2 * afterblowsAgainst) - score + doubles', 'Afterblow Wins', 'afterblowsAgainst', 'Doubles', 'doubles', 'Score', 'score'),
(10, '2 Point Cumulative', 1, 'Used for Singlestick in Helsinki Open 2018\r\n\r\nScoring:\r\n2 Points for Win\r\n1 Point for Tie\r\n\r\nRanking:\r\nBy Score', 0, 1, 0, NULL, NULL, NULL, 'FNY2017', '(2 * wins) + ties', 0, 'score', 'DESC', 'wins', 'DESC', 'doubles', 'ASC', 'Wins', 'wins', 'Ties', 'ties', 'Losses', 'losses', 'Score', 'score', NULL, NULL),
(11, 'Flowerpoint', 2, 'Score\r\n-1 Point for every time hit\r\n(Scoring action or double)\r\n\r\nRanking\r\nBy score', 0, 1, 0, NULL, NULL, NULL, 'Flowerpoint', '0 - hitsAgainst - doubles', 0, 'score', 'DESC', 'doubles', 'ASC', 'wins', 'DESC', 'Number of Times Hit', 'hitsAgainst', 'Doubles', 'doubles', 'Score', 'score', NULL, NULL, NULL, NULL),
(13, 'Thokk Continuous', 1, NULL, 0, 1, 0, NULL, NULL, NULL, 'SimpleRankOrder', '0 - AbsPointsAgainst', 0, 'hitsAgainst', 'ASC', 'hitsFor', 'DESC', 'score', 'DESC', 'Bouts Won', 'hitsFor', 'Bouts Lost', 'hitsAgainst', 'Points Against', 'pointsAgainst', NULL, NULL, NULL, NULL),
(14, 'Alls Fair', 2, 'Ranking:\r\n1) Wins\r\n2) Doubles\r\n3) Points +/-', 0, 1, 0, NULL, NULL, NULL, 'SimpleRankOrder', 'pointsFor - pointsAgainst', 0, 'wins', 'DESC', 'doubles', 'ASC', 'score', 'DESC', 'Wins', 'wins', 'Doubles', 'doubles', 'Points For', 'pointsFor', 'Points Against', 'pointsAgainst', 'Points +/-', 'score');
